  return (
    <div className="settings">
 <div className="settingsWrapper">
    <div className="settingTitle">
        <span className="settingUpdateTitle">Update Your Account</span>
        <span className="settingTitle">Update Your Account</span>
    </div>
 </div>
 <Sidebar/>
    </div>
  )
}
